import {
  red,
  blue,
  common,
  gray,
  green,
  orange,
  pink,
  yellow,
} from "../colors";
export default {
  colors: { red, blue, common, gray, green, orange, pink, yellow },

  name: "lightTheme",
  primaryColor: "#f8049c",
  secondaryColor: "#fdd54f",
};
